import React from "react";
import Calling from "../components/project_1/calling_back";
import Table from "../components/project_2/table";
import { Link } from "react-router-dom";

function Home() {
    return (
        <div>
            {/* frame a box for project show cases  and links too*/}
            {/* div for the cards to book a project */}
            <h1>Project Showcase</h1>
            <h2>Project 1</h2>
            <Calling />
            <h2>Project 2</h2>
            <Table />
            <h2>Links</h2>
            <Link to={"/"}>Home</Link>
            <br />
            <br />
            <br />
            <br />
            <br />
            <br />
            
            <Link to={"/calling"}>Calling</Link>
            <Link to={"/table"}>Table</Link>
        </div>
    );
}

export default Home;
